#https://discuss.pennylane.ai/t/count-cnot-gates-and-pauli-gates-in-hamiltonian/1745/5
from pennylane.ops.qubit.non_parametric_ops import PauliX, PauliY, PauliZ 
from pennylane.operation import Tensor
def count_paulis(H):
    """
    Counts the number of Pauli operations in a Hamiltonian. Note that each Pauli
    operator contained in tensor products are counted individually e.g:
    qml.PauliX(0) @ qml.PauliX(1) counts as 2. Identity operations are not 
    counted as Pauli operations here.
    
    Args: 
        H (qml.Hamiltonian): The Hamiltonian containing operations to be counted
    
    Returns:
        count (int): the number of Pauli operations contained in the Hamiltonian
    """
    pauli_types = (PauliX)

    count = 0
    for op in H.ops:
        if type(op) == Tensor:
            for obs in op.obs:
                if type(obs) in pauli_types:
                    count += 1
        elif type(op) in pauli_types:
            count += 1
            
    return count 

n_PauliXs = str(hamiltonian.ops).count('PauliX')

x = np.array([0.1, 0.2])
dev = qml.device('default.qubit', wires=2)
@qml.qnode(dev, diff_method="parameter-shift", shift=np.pi / 4)
def circuit(x, add_ry=True):
    qml.RX(x[0], wires=0)
    qml.CNOT(wires=(0,1))
    if add_ry:
        qml.RY(x[1], wires=1)
    return qml.probs(wires=(0,1))

#https://pennylane.readthedocs.io/en/stable/code/api/pennylane.specs.html
circuit_depth = qml.specs(circuit)(x)

